import React from 'react'

import {
    ContainerCalls,
    IconLoader,
    ContainerTexts,
    Name,
    Message,
    Date,
    ContainerSpaceBeetwen,
    Image
} from './styles'

import loader from '../../../assets/Icons/loader.png'

type ButtonProps = {
    name: string;
    message: string;
    date: string;
    onPress: () => void;
}

export function ListCallsCategory({name,message,date,onPress}: ButtonProps) {
    return (
        <ContainerCalls onPress={onPress}>
            <IconLoader>
                {/* <Image
                    source={loader}
                /> */}
            </IconLoader>
            <ContainerSpaceBeetwen>
                <ContainerTexts>
                    <Name>{name}</Name>
                    <Message>{message}</Message>
                </ContainerTexts>
                <Date>{date}</Date>
            </ContainerSpaceBeetwen>
        </ContainerCalls>
    )
}
